import "./App.css";

function App() {
  const users = [
    { name: "Najad", age: 26 },
    { name: "Hanad", age: 24 },
    { name: "Ahmed", age: 20 }
  ];

  return (
    <div className="App">
      {users.map((user, key) => {
        return (
          <>
            <h1 key={key}>
              <User name={user.name} age={user.age} />
            </h1>
          </>
        );
      })}
    </div>
  );
}

const User = (props) => {
  <h1>
    {props.name}, {props.age}
  </h1>;
};

export default App;



